import React from 'react';
import { ITask } from '../interfaces';

interface Props {
    task: ITask;
    deleteTask(): void;
}

const ShowTask = ({task, deleteTask }: Props) => {
    return (
        <div className="item">
            <input type="checkbox"/>
            <label className="item">
                {task.taskName}
            </label>
        </div>
    );
}

export default ShowTask;
